import React from "react";
import Stopwatch from "./Stopwatch/Stopwatch";
import Text from "./Text/Text";
import Input from "./Input/Input";
import ControlButtons from "./Stopwatch/ControlButtons/ControlButtons";
import './App.css';

function App() {

  return (
    <div className="App">
      <header className="App-header">
        <Stopwatch />
      </header>
      <div>
      <Input />
        <Text />
        {<ControlButtons
          active={isActive}
          isPaused={isPaused}
          handleStart={handleStart}
          handlePauseResume={handlePauseResume}
        />}
      </div>
    </div>
  );
}

export default App;
